    String value;

    GiftHeads(String value) {
        this.value = value;
    }

    public ItemBuilder asBuilder() {
        ItemBuilder builder = ItemBuilder.start(Material.PLAYER_HEAD);
        PlayerProfile profile = Bukkit.createProfile(UUID.randomUUID());
        ProfileProperty prop = new ProfileProperty("textures", value);
        profile.setProperty(prop);
        builder.owner(profile);
        builder.name(format());
        return builder;
    }

    private String format() {
        String name = name();
        name = name.replaceAll("_", " ");
        return Character.toUpperCase(name.charAt(0)) + name.substring(1).toLowerCase();
    }

